import React from "react";
import HeaderHome from "../../components/Header";
import { ThemeDiv } from "./style";

const Home = () => {
  return (
    <>
      <HeaderHome />
      <ThemeDiv>
        <div>
          <h2>Oque somos?</h2>
        </div>
        <div><h2>Oque somos?</h2></div>
      </ThemeDiv>
    </>
  );
};

export default Home;
